import React from "react";
import {Route, Switch} from "react-router-dom";

import asyncComponent from "util/asyncComponent";

const DataFoxRouter = ({match}) => (
  <div>
    <Switch>
      <Route path={`${match.url}fox/dashboard`} component={asyncComponent(() => import('../dashboard/index.js'))}/>
      <Route path={`${match.url}fox/feeds/`} component={asyncComponent(() => import('../feeds/index.js'))}/>
      <Route path={`${match.url}fox/testing`} component={asyncComponent(() => import('../testing/index.js'))}/>
    </Switch>
  </div>
);

export default DataFoxRouter;
